import React from "react";
import { motion } from "framer-motion"

function Beginning (){
return (<div
className="containter">

<motion.div className="box"
            animate={{rotate:360}}
            transition={{from:1, duration:2,repeat:Infinity}}
>

</motion.div>

</div>);
}
export default Beginning;
